import com.eviware.soapui.support.XmlHolder
import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext

//a) Fetch the current request soap message from add employee test step - get it from REQUEST variable
def addCustTSRequestValue = testRunner.testCase.testSuite.testCases["AddCustomerTC"].testSteps["addCustTS"].getPropertyValue("Request")
log.info addCustTSRequestValue

//b) Parse the request varianle value in order to add or remove data
def parseRequest = new XmlHolder(addCustTSRequestValue)

//c)Add the values to respective nodes - use the setNodeValue --> 	setNodeValue(java.lang.String xpath, java.lang.Object value)
parseRequest.setNodeValue("//def:customerCustomerRepositoryV1SaveRequest/customer/email", "harini8@gmail.com")
parseRequest.setNodeValue("//def:customerCustomerRepositoryV1SaveRequest/customer/firstname", "test")
parseRequest.setNodeValue("//def:customerCustomerRepositoryV1SaveRequest/customer/lastname", "test")

//d)The above addition of the node value will create a new XML 
def newXMLAddCustTS = parseRequest.getXml()
log.info newXMLAddCustTS

//e) Add the new xml to the REQUEST variable of AddEmpoyee Test Step
def updatedRequest=testRunner.testCase.testSuite.testCases["AddCustomerTC"].testSteps["addCustTS"].setPropertyValue("Request",newXMLAddCustTS)

log.info updatedRequest
//2)click on SUBMIT button of add employee test step from groovy script level
//a) Move the pointer from GroovyScript test step to add employee test step
def pointeraddCustTS = testRunner.testCase.testSuite.testCases["AddCustomerTC"].testSteps["addCustTS"]


//b) After pointing click on the SUBMIT button

def contextAddCust= new WsdlTestRunContext(pointeraddCustTS)

//c) Us ethe run method to click the submit button
pointeraddCustTS.run(testRunner, contextAddCust)



//GetCustomer by Id
def getAddCustTSResponseValue = testRunner.testCase.testSuite.testCases["AddCustomerTC"].testSteps["addCustTS"].getPropertyValue("Response")
log.info getAddCustTSResponseValue
def parseRequest2 = new XmlHolder(getAddCustTSResponseValue)
def custId=parseRequest2.getNodeValue("//ns1:customerCustomerRepositoryV1SaveResponse/result/id")

def getCustTSRequestValue = testRunner.testCase.testSuite.testCases["GetcustomerByID"].testSteps["getCustID"].getPropertyValue("Request")
log.info getCustTSRequestValue
def parseRequest3 = new XmlHolder(getCustTSRequestValue)
parseRequest3.setNodeValue("//def:customerCustomerRepositoryV1GetByIdRequest/customerId", custId)
def newXMLgetCustTS = parseRequest3.getXml()
def updatedRequestCust=testRunner.testCase.testSuite.testCases["GetcustomerByID"].testSteps["getCustID"].setPropertyValue("Request",newXMLgetCustTS)

def pointergetCustTS = testRunner.testCase.testSuite.testCases["GetcustomerByID"].testSteps["getCustID"]
def contextGetCust= new WsdlTestRunContext(pointergetCustTS)
pointergetCustTS.run(testRunner, contextGetCust)

//Delete customer with id

def delCustTSRequestValue = testRunner.testCase.testSuite.testCases["DeleteCustomerTC"].testSteps["delCustId"].getPropertyValue("Request")
log.info delCustTSRequestValue
def parseRequest4 = new XmlHolder(delCustTSRequestValue)
log.info custId
parseRequest4.setNodeValue("//def:customerCustomerRepositoryV1DeleteByIdRequest/customerId", custId)
def newXMLdelCustTS = parseRequest4.getXml()
def updatedRequestDelCust=testRunner.testCase.testSuite.testCases["DeleteCustomerTC"].testSteps["delCustId"].setPropertyValue("Request",newXMLdelCustTS)

def pointergetDelCustTS = testRunner.testCase.testSuite.testCases["DeleteCustomerTC"].testSteps["delCustId"]
def contextDelCust= new WsdlTestRunContext(pointergetDelCustTS)
pointergetDelCustTS.run(testRunner, contextDelCust)
